import React from "react";

function Timp(props) {
  return (
    <>
          <h2>
              Esti la intrebarea { } din
        Timp trecut: {props.DigitFour % 10}
        {props.DigitThere % 10}
        {props.DigitTwo % 10}
        {props.DigitOne % 10}
      </h2>
    </>
  );
}

let counter = 0;

export default Timp;
